const fs = require('fs');
function getFilter(test) {
  let nvert = map.length
  let i, j, c = 0
  for (i = 0, j = nvert - 1; i < nvert; j = i++) {
    if (
      ((map[i][1] > test.station_lat) != (map[j][1] > test.station_lat)) &&
    (test.station_lng < (map[j][0]-map[i][0]) * (test.station_lat-map[i][1]) / (map[j][1]-map[i][1]) + map[i][0]) )
    c = !c; 
  }
  return c
}
  
let filterPoint = point.filter(item => {
  return getFilter(item)
})


